<link rel="import" href="../behaviors/AgsFormTemplate.html">
<dom-module id="ags-field-range-template">
    <script>
        (function() {
            "use strict";
        
            var AgsFieldRangeTemplate = Polymer({
                is: "ags-field-range-template",
                behaviors: [Augeas.AgsFormTemplate],
                isMatch: function(property, range) {
                    return this.range && this.range == range;
                }
            });
        
        
        
        }());
    </script>
</dom-module>
